def isSolid(map, x,y,dx,dy, mode=1):
    x_map = x*speed_x + dx
    y_map = y + dy

    if y_map < 0:
        return True
    if mode == 2 and y_map > 26*10:
        return True
    elif map_original[int(y_map), x_map] == 1:
        return True
    return False

def isJump(i):
    return i==1

