def playGame(input):
    hook = MemoryHooker.MemoryHooker(pid)
    keyboard = MemoryHooker.Keyboard()

    ## Unpause
    keyboard.pressKey(0x19) #P
    time.sleep(2/fps)
    keyboard.releaseKey(0x19)

    while 1:
        value = hook.readInt32(address)
        x = (value - 6) // 8
        i = ((x - offset_x) // speed_x)+2 ## Small adjustment because the map is shifted for some reason in-game
        if (i >= len(input)):
            ## Dead
            keyboard.releaseKey(0x11)  # Release W
            break
        else:
            #print(value, x, i, input[i])
            jump = input[i]
            for e in user_enable:
                if i>=e[0] and i<=e[1]:
                    jump = user_inputs[i]
                    break

            if jump:
                keyboard.pressKey(0x11)  # Press W
            else:
                keyboard.releaseKey(0x11)  # Release W
                ##hook.sendKeys("w")

        time.sleep(1 / fps)

    count = 0
    while 1:
        value = hook.readInt32(address)
        x = (value - 6) // 8
        i = (x - offset_x) // speed_x
        if (i < len(input)):
            ## Respawned
            count += 1

        if count > 4:
            break

        time.sleep(1 / fps)

    ## Pause
    keyboard.pressKey(0x19)  # P
    time.sleep(2 / fps)
    keyboard.releaseKey(0x19)

    hook.close()


import random
from deap import base, creator, tools

n_genes = map.shape[1]
n_individuals = 50
n_parents = 3 #int(n_individuals*0.05)
frames_lookback_mutate = 50 #How many frames to look back for mutation
frames_lookforward_mutate = 0 #How many frames to look back for mutation
p_jump = 0.05 #Initial probability of each gene signalling jump
p_mutate = 0.8 # Probability of mutating at all after evaluation
p_gene_mutate = 0.1 #Probability of a single gene flipping
p_cross = 0.0 #Probability two creatures are crossed










def mutate(individual, indpb):
    """Flip the value of the attributes of the input individual and return the
    mutant. The *individual* is expected to be a :term:`sequence` and the values of the
    attributes shall stay valid after the ``not`` operator is called on them.
    The *indpb* argument is the probability of each attribute to be
    flipped. This mutation is usually applied on boolean individuals.
    :param individual: Individual to be mutated.
    :param indpb: Independent probability for each attribute to be flipped.
    :returns: A tuple of one individual.
    This function uses the :func:`~random.random` function from the python base
    :mod:`random` module.
    """
    ## Only mutate the last "lookback" number of genes and the next "frames_lookforward_mutate" genes
    max_idx = int(individual.fitness.values[1]+frames_lookforward_mutate)
    min_idx = max(0, max_idx-frames_lookback_mutate)

    for i in range(min_idx, max_idx):
        if random.random() < indpb:
            individual[i] = type(individual[i])(not individual[i])

    return individual,

def randGene():
    if random.random() <= p_jump:
        return 1
    return 0


creator.create("FitnessMax", base.Fitness, weights=(1,1))
creator.create("Individual", list, fitness=creator.FitnessMax)

toolbox = base.Toolbox()
#toolbox.register("attr_bool", random.randint, 0, 1)
toolbox.register("attr_bool", randGene)
toolbox.register("individual", tools.initRepeat, creator.Individual, toolbox.attr_bool, n_genes)
toolbox.register("population", tools.initRepeat, list, toolbox.individual)

toolbox.register("evaluate", evaluateInput)
toolbox.register("mate", tools.cxTwoPoint)
#toolbox.register("mutate", tools.mutFlipBit, indpb=p_gene_mutate)
toolbox.register("mutate", mutate, indpb=p_gene_mutate)
toolbox.register("select", tools.selTournament, tournsize=n_parents)


def main(cp_file):
    random.seed(8)

    if os.path.isfile(cp_file):
        with open(cp_file, "rb") as f:
            cp = pickle.load(f)

        pop = cp["population"]
        g = cp["generation"]

        diff = map.shape[1]-len(pop[0])
        if diff>0:
            diff = list(np.zeros((diff)))
            for i in pop:
                i.extend(diff)

    else:
        pop = toolbox.population(n=n_individuals)
        g = 0

    print("Start of evolution")

    # Evaluate the entire population
    for ind in pop:
        xpos, score, map_img = toolbox.evaluate(ind, map)
        ind.fitness.values = (score, xpos)

    print("  Evaluated %i individuals" % len(pop))

    # Extracting all the fitnesses of
    fits = [ind.fitness.values[0] for ind in pop]

    # Variable keeping track of the number of generations
    prev_max_score = 0
    prev_max_dist = 0

    # Begin the evolution
    while g < 1000: #and max(fits) < 960
        # A new generation
        g = g + 1
        print("-- Generation %i --" % g)

        # Select the next generation individuals
        offspring_temp = toolbox.select(pop, len(pop))
        # Clone the selected individuals
        offspring = []
        for o in offspring_temp:
            offspring.append(toolbox.clone(o))

        # Apply crossover and mutation on the offspring
        for child1, child2 in zip(offspring[::2], offspring[1::2]):
            if random.random() < p_cross:
                toolbox.mate(child1, child2)

                # fitness values of the children
                # must be recalculated later
                #del child1.fitness.values
                #del child2.fitness.values

        for mutant in offspring:
            if random.random() < p_mutate:
                toolbox.mutate(mutant)
                del mutant.fitness.values

        # Evaluate the individuals with an invalid fitness
        max_score = -np.inf
        max_map_img = None
        max_ind = None

        invalid_ind = [ind for ind in offspring if not ind.fitness.valid]
        for ind in invalid_ind:
            xpos, score, map_img = toolbox.evaluate(ind, map)
            ind.fitness.values = (score, xpos)

            if score > max_score:
                max_score = score
                max_dist = ((xpos*9)+13)//26
                max_map_img = map_img
                max_ind = ind
        
        print("  Evaluated %i individuals" % len(invalid_ind))

        # The population is entirely replaced by the offspring
        pop[:] = offspring

        # Gather all the fitnesses in one list and print the stats
        fits = [ind.fitness.values[0] for ind in pop]

        length = len(pop)
        mean = sum(fits) / length
        sum2 = sum(x * x for x in fits)
        std = abs(sum2 / length - mean ** 2) ** 0.5

        print("  Min %s" % min(fits))
        print("  Max %s" % max(fits))
        print("  Avg %s" % mean)
        print("  Std %s" % std)


        ## Create a checkpoint
        if g%cp_freq == 0:
            cp = dict(population=pop, generation=g)
            with open(cp_file, "wb") as f:
                pickle.dump(cp, f)


        ## Let's see our progress
        print(max_ind)

        max_map_img = np.flip(max_map_img, axis=0)
        max_map_img = max_map_img.astype(np.uint8)
        max_map_img = cv2.putText(max_map_img, "Generation %4d" % g, (20, 40), cv2.FONT_HERSHEY_DUPLEX, 1.0, (0, 0, 0),
                                  lineType=cv2.LINE_AA, bottomLeftOrigin=False)
        max_map_img = cv2.putText(max_map_img, "Fitness:    %4d" % max_score, (20, 70), cv2.FONT_HERSHEY_DUPLEX, 1.0, (0, 0, 0),
                                  lineType=cv2.LINE_AA, bottomLeftOrigin=False)
        max_map_img = cv2.putText(max_map_img, "Distance:    %4d" % max_dist, (20, 100), cv2.FONT_HERSHEY_DUPLEX, 1.0,
                                  (0, 0, 0),
                                  lineType=cv2.LINE_AA, bottomLeftOrigin=False)
        cv2.imshow("Best trajectory", max_map_img)
        cv2.moveWindow("Best trajectory", 0, 0)
        cv2.waitKey(1)

        #if max_score >= prev_max_score + video_points:
        if max_dist >= prev_max_dist + video_dist:
            prev_max_score = max_score
            prev_max_dist = max_dist
            playGame(max_ind)

        if max_ind.fitness.values[1] >= map.shape[1]:
            break

    print("-- End of (successful) evolution --")

    best_ind = tools.selBest(pop, 1)[0]
    print("Best individual is %s, %s" % (best_ind, best_ind.fitness.values))


if __name__ == "__main__":
    main(cp_file)